import React, { useState } from 'react'
import { FaSearch } from 'react-icons/fa'

export default function Search() {

  const [openMenu, setOpenMenu] = useState(false)

  function toggleMenu(){
    setOpenMenu(!openMenu)
    
  }
  return (
    <div className="search" onClick={toggleMenu}>
      <FaSearch />
    </div>
  )
}
